import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCloudRain, faCloud, faSun, faWind } from '@fortawesome/free-solid-svg-icons'  

export default function WeatherIcon(weatherType){
	console.log('weatherType', weatherType);

	switch(WeatherType) {
		case 'Rain':
			return (
				<FontAwesomeIcon icon={faCloudRain} className='WeatherIcon' size='6px'/>
			);
		case 'Cloudy':
			return (
				<FontAwesomeIcon icon={faCloud} className='WeatherIcon' size='6px'/>
			);
		case 'Sunny':
			return (
				<FontAwesomeIcon icon={faSun} className='WeatherIcon' size='6px'/>
			);
		case 'Windy':
			return (
				<FontAwesomeIcon icon={faWind} className='WeatherIcon' size='6px'/>
			);
		default:
			return <div>{weatherType}</div>
	}
}
